 = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===9){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"0d426901-a06d-41ce-a92d-8830685130cb","type":"CustomJS"},{"attributes":{"data_source":{"id":"bcc8e155-fb1f-4285-958a-00d6c71a0eeb","type":"ColumnDataSource"},"glyph":{"id":"60cf276b-60b8-4c5f-8321-e3d816ffdd5a","type":"Circle"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"ec336ba5-3718-4cb4-9001-2ede55db6942","type":"Circle"},"selection_glyph":null,"view":{"id":"fa71e190-6778-4373-82a3-d16dcde35ab6","type":"CDSView"}},"id":"2465d572-b41b-4266-8af8-710484666e64","type":"GlyphRenderer"},{"attributes":{"callback":null},"id":"5c4e376c-915b-4843-a823-94df2e43bc4d","type":"DataRange1d"},{"attributes":{},"id":"8a5e9edd-05af-4e71-8a38-4cb6a728cbc5","type":"PanTool"},{"attributes":{},"id":"b5cd2aeb-5510-4c47-b9db-f22e14839ea2","type":"ResetTool"},{"attributes":{},"id":"229844f5-7860-409d-bda5-81944c172e52","type":"WheelZoomTool"},{"attributes":{"dimension":1,"plot":{"id":"78b97b67-4be9-4d0c-82d4-0a00b68730cd","subtype":"Figure","type":"Plot"},"ticker":{"id":"c981b722-0670-4e2f-a78c-9a4b490af30c","type":"BasicTicker"}},"id":"7117dadd-09b9-47ab-b404-c29dfa7d354f","type":"Grid"},{"attributes":{"plot":{"id":"78b97b67-4be9-4d0c-82d4-0a00b68730cd","subtype":"Figure","type":"Plot"},"ticker":{"id":"eb9b79b6-122b-4722-847b-93a4bafd1b47","type":"BasicTicker"}},"id":"868f9682-bef4-479d-a6a0-4af76f999a40","type":"Grid"},{"attributes":{},"id":"dada4b04-10b7-47b8-8a16-9724a7bc77a2","type":"SaveTool"},{"attributes":{"source":{"id":"bcc8e155-fb1f-4285-958a-00d6c71a0eeb","type":"ColumnDataS
